import React, {useState, useEffect} from 'react';
import useCustomFetch from '../../hooks/useCustomFetch';
import PaqListCard from '../../layout/PaqListCard';
import {PaqListContainer} from '../../elements/Container';


const PaqList = () => {

    const [paquetesResponse, setPaquetesResponse] = useState([]);
    const [url, setUrl] = useState(null);
    const [paquetes] = useCustomFetch(url);

    useEffect( () => {
        setUrl(`/paquetes/`)
    }, [url]);

    useEffect( () => {
        setPaquetesResponse(paquetes)
    }, [paquetes]);

    // console.log(paquetesResponse);
    // console.log(paquetes);

    return (
        <>          
          <PaqListContainer>
            {paquetesResponse.map( (paquete,idx) =>              
                <PaqListCard                     
                    key={idx}
                    id={paquete.id}
                    nombre={paquete.nombre}
                    tamaño={paquete.tamaño}
                    precio={paquete.precio}                    
                    paquete={paquete.paquete}
                    // category={match.params.category} 
                />
            )}            
          </PaqListContainer>
        </>
    );
};

export default PaqList;
